// Utility functions for seeding
export const getCarsByBrand = (brandName: string): CarSeedData[] => {
  return carsData.filter(car => car.brandName === brandName);
};

export const getCarsByCustomer = (customerMobile: string): CarSeedData[] => {
  return carsData.filter(car => car.customerMobile === customerMobile);
};

export const getBrandStats = (): Record<string, number> => {
  return carsData.reduce((stats, car) => {
    stats[car.brandName] = (stats[car.brandName] || 0) + 1;
    return stats;
  }, {} as Record<string, number>);
};

export const getModelStats = (): Record<string, number> => {
  return carsData.reduce((stats, car) => {
    const modelKey = `${car.brandName} ${car.modelName}`;
    stats[modelKey] = (stats[modelKey] || 0) + 1;
    return stats;
  }, {} as Record<string, number>);
};

export const getColorStats = (): Record<string, number> => {
  return carsData.reduce((stats, car) => {
    const color = car.color || 'Unknown';
    stats[color] = (stats[color] || 0) + 1;
    return stats;
  }, {} as Record<string, number>);
};

export const getYearStats = (): Record<string, number> => {
  return carsData.reduce((stats, car) => {
    const year = car.year?.toString() || 'Unknown';
    stats[year] = (stats[year] || 0) + 1;
    return stats;
  }, {} as Record<string, number>);
};

// Summary statistics
export const summary = {
  totalCars: carsData.length,
  uniqueBrands: new Set(carsData.map(car => car.brandName)).size,
  uniqueModels: new Set(carsData.map(car => `${car.brandName} ${car.modelName}`)).size,
  uniqueCustomers: new Set(carsData.map(car => car.customerMobile)).size,
  carsWithYear: carsData.filter(car => car.year !== null).length,
  carsWithColor: carsData.filter(car => car.color !== null).length,
  brandStats: getBrandStats(),
  modelStats: getModelStats(),
  colorStats: getColorStats(),
  yearStats: getYearStats()
};

export default carsData;
